WITH duplicates AS (
    SELECT *,
           ROW_NUMBER() OVER (PARTITION BY name ORDER BY id) AS rn
    FROM restaurant
)
DELETE FROM restaurant
WHERE id IN (
    SELECT id FROM duplicates WHERE rn > 1
);

SELECT id, name, is_chinois, address, latitude, longitude
FROM restaurant
ORDER BY name;

