const rows = items.map(i => i.json);

const html = `
<!DOCTYPE html>
<html lang="fr">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <title>Restaurants Chinois - Interface Interactive</title>
  <style>
    body {
      font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
      background-color: #f5f5f7;
      margin: 0; padding: 40px 20px;
      color: #1d1d1f;
    }

    h1 {
      text-align: center;
      font-size: 2.5em;
      font-weight: 600;
      margin-bottom: 30px;
    }

    #search {
      display: block;
      margin: 0 auto 30px auto;
      width: 300px; padding: 12px 16px;
      font-size: 16px;
      border-radius: 12px;
      border: 1px solid #ccc;
      box-shadow: 0 1px 2px rgba(0,0,0,0.05);
      transition: all 0.2s ease-in-out;
    }

    #search:focus {
      outline: none;
      border-color: #007aff;
      box-shadow: 0 0 0 3px rgba(0, 122, 255, 0.2);
    }

    table {
      width: 100%;
      max-width: 960px;
      margin: 0 auto;
      border-collapse: collapse;
      background: white;
      border-radius: 16px;
      overflow: hidden;
      box-shadow: 0 8px 20px rgba(0, 0, 0, 0.05);
    }

    thead {
      background-color: #e5e5ea;
    }

    th, td {
      padding: 16px;
      text-align: left;
    }

    tbody tr {
      border-bottom: 1px solid #f0f0f0;
      transition: background 0.25s ease, transform 0.15s ease;
    }

    tbody tr:hover {
      background-color: #f9f9f9;
      transform: scale(1.002);
    }

    .badge {
      padding: 6px 12px;
      border-radius: 20px;
      font-weight: 600;
      font-size: 14px;
      display: inline-block;
      transition: background 0.3s, color 0.3s;
    }

    .chinois .badge {
      background-color: #d1f7c4;
      color: #27ae60;
    }

    .non-chinois .badge {
      background-color: #fdecea;
      color: #c0392b;
    }

    @media (max-width: 640px) {
      table, thead, tbody, th, td, tr {
        display: block;
      }
      thead tr {
        display: none;
      }
      tbody tr {
        margin-bottom: 15px;
        background: white;
        border-radius: 12px;
        box-shadow: 0 4px 10px rgba(0,0,0,0.05);
        padding: 15px;
      }
      td {
        padding: 10px 0;
        position: relative;
      }
      td::before {
        content: attr(data-label);
        font-weight: bold;
        display: block;
        margin-bottom: 5px;
        color: #999;
      }
    }
  </style>
</head>
<body>

<h1>üçú Restaurants Chinois</h1>

<input type="text" id="search" placeholder="üîç Rechercher un restaurant..." />

<table>
  <thead>
    <tr>
      <th>ID</th>
      <th>Nom</th>
      <th>Adresse</th>
      <th>Chinois</th>
    </tr>
  </thead>
  <tbody id="table-body">
    ${rows.map(r => `
      <tr class="${r.is_chinois ? 'chinois' : 'non-chinois'}">
        <td data-label="ID">${r.id}</td>
        <td data-label="Nom">${r.name || '(aucun nom)'}</td>
        <td data-label="Adresse">${r.address || '(aucune adresse)'}</td>
        <td data-label="Chinois">
          <span class="badge">${r.is_chinois ? '‚úÖ Oui (Chinois)' : '‚ùå Non'}</span>
        </td>
      </tr>
    `).join('')}
  </tbody>
</table>

<script>
  const searchInput = document.getElementById('search');
  const tableBody = document.getElementById('table-body');

  searchInput.addEventListener('input', function () {
    const filter = this.value.toLowerCase();
    const rows = tableBody.querySelectorAll('tr');
    rows.forEach(row => {
      const nom = row.cells[1].textContent.toLowerCase();
      const adresse = row.cells[2].textContent.toLowerCase();
      if (nom.includes(filter) || adresse.includes(filter)) {
        row.style.display = '';
      } else {
        row.style.display = 'none';
      }
    });
  });
</script>

</body>
</html>
`;

// Encodage en base64
const buffer = Buffer.from(html, 'utf-8');
const base64Html = buffer.toString('base64');

return [{
  json: { fileName: "restaurants_interactifs.html" },
  binary: {
    data: {
      data: base64Html,
      mimeType: 'text/html',
      fileName: 'restaurants_interactifs.html',
    }
  }
}];
